import { useState, useEffect } from "react";
import Wrapper from "../styled-components/Wrapper";
import Hero from "../styled-components/Hero";
import Footer from "../styled-components/Footer";
import Language from "../styled-components/Language";
import HeroEN from "../styled-components/HeroEN";
import Form from "../styled-components/Form";
import Input from "../styled-components/Input";
import Button from "../styled-components/Button";
import ErrorMessage from "../styled-components/ErrorMessage"; // Importamos el componente de mensaje de error

function Lalora() {
  const [language, setLanguage] = useState("español");
  const [formData, setFormData] = useState({
    nombre: "",
    correo: ""
  });
  const [errors, setErrors] = useState({});

  useEffect(() => {
    (() => {
      if (localStorage.getItem("bajoNaranja")) {
        setLanguage(JSON.parse(localStorage.getItem("bajoNaranja")).language);
      }
    })();
  }, []);

  const handleChange = (event) => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    const errors = validateFormData(formData);
    if (Object.keys(errors).length === 0) {
      // Aquí puedes implementar la lógica para enviar el formulario
      console.log("Formulario enviado:", formData);
    } else {
      setErrors(errors);
    }
  };

  const validateFormData = (data) => {
    const errors = {};
    if (!data.nombre.trim()) {
      errors.nombre = "El nombre es obligatorio";
    }
    if (!data.correo.trim()) {
      errors.correo = "El correo electrónico es obligatorio";
    } else if (!isValidEmail(data.correo)) {
      errors.correo = "El correo electrónico no es válido";
    }
    return errors;
  };

  const isValidEmail = (email) => {
    // Validación simple del formato de correo electrónico
    const re = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    return re.test(email);
  };

  const languageChange = () => {
    if (language === "english") {
      localStorage.removeItem("bajoNaranja");
      return window.location.reload();
    }
    localStorage.setItem(
      "bajoNaranja",
      JSON.stringify({ language: "english" })
    );
    return window.location.reload();
  };

  return (
    <Wrapper>
      <Language onClick={languageChange}>{language}</Language>
      <div className="wrapper--max">
        {language === "español" ? <Hero /> : <HeroEN />}
      </div>
      <div className="wrapper--max">
        {language === "español" ? (
          <>
            <Form onSubmit={handleSubmit}>
              <Input
                type="text"
                name="nombre"
                value={formData.nombre}
                placeholder="Nombre"
                onChange={handleChange}
              />
              {errors.nombre && <ErrorMessage>{errors.nombre}</ErrorMessage>}
              <Input
                type="email"
                name="correo"
                value={formData.correo}
                placeholder="Correo electrónico"
                onChange={handleChange}
              />
              {errors.correo && <ErrorMessage>{errors.correo}</ErrorMessage>}
              <Button type="submit">Solicitar Entrada</Button>
            </Form>
          </>
        ) : (
          <>
            <Form onSubmit={handleSubmit}>
              <Input
                type="text"
                name="nombre"
                value={formData.nombre}
                placeholder="Name"
                onChange={handleChange}
              />
              {errors.nombre && <ErrorMessage>{errors.nombre}</ErrorMessage>}
              <Input
                type="email"
                name="correo"
                value={formData.correo}
                placeholder="Email"
                onChange={handleChange}
              />
              {errors.correo && <ErrorMessage>{errors.correo}</ErrorMessage>}
              <Button type="submit">Request Entry</Button>
            </Form>
          </>
        )}
      </div>
      <Footer />
    </Wrapper>
  );
}

export default Lalora;
